import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <>
    <h1>Venta de Automoviles</h1>
    <strong>Vehiculos disponibles</strong>
    <li>Maseratti</li>
    <li>Ferrari</li>
    <li>Aston Martin</li>
    <li>Lamborghini</li>
  </>
  );
}

export default App;
